import React from 'react'

const Select = (props: any) => {
    const notSelected = props.options.filter((element) => props.selected.includes(element));
    return (
        <fieldset>
            <label htmlFor={props.id}>Answer</label>
            <select
            name={props.id}
            id={props.id}
            onChange={props.onChange}
            defaultValue={props.defaultValue}
            >
                <option value="default" disabled>
                - Select -
                </option>
                {props.options.map((element: string, index: number) => <option key={`options ${index}`}>{element}</option>)}
                <optgroup label="Already selected">
                    {props.selected.map((element: string, index: number) => <option key={`selectedOptions ${index}`}>{element}</option>)}
                </optgroup>
            </select>
        </fieldset>
    )
}

export default Select;
